// SPDX-License-Identifier:MIT
pragma solidity ^0.8;  

contract DeleteExample {
    uint data;
    uint[] dataArray;
    function f() public {
        uint x = data;
        delete x; 
        delete data; 
        uint[] storage y = dataArray;
        delete dataArray; 
        assert(y.length == 0);
    }
}
